//React
import { useNavigate, Link } from 'react-router-dom'

//CSS
import './Sucess.css'

//Icon
import iconSucess from '/home/leonardo/Destiny/destiny/src/icon-sucess.jpg'

export default function Sucess() {
    const home = useNavigate()

    return (
        <div className="message-sucess">
            <img src={iconSucess} alt="Sucess Icon" />
            <h1>Sua postagem foi adicionada com sucesso!</h1>
            <div className="button-sucess">
                <button onClick={() => home('/')}>
                    Pagina Inicial
                </button>
                <button>
                    <Link to="/Cadastrar">Cadastrar outro post</Link>
                </button>
            </div>
        </div>
    )
}
